import React from 'react'
import ReactDom from 'react-dom'
import App from './app'
// import Sidebar from './components/sidebar'
// import Datatablesertifikasi from "../src/components/content/m_sertifikasi/list_sertifikasi";
// import Detailpelamar from "./components/detailpelamar"
import {BrowserRouter} from 'react-router-dom'

ReactDom.render(
    <BrowserRouter>
    <App />
    </BrowserRouter>,
    document.getElementById('app')
)
